def test_documents_put_doc_id_permission():
    
    # succesfully added access
    payload = {
        "user": "userB",
        "level": "r"
    }
    headers = {
        'Authorization': 'Bearer ' + TOKEN_A
    }
    response = requests.put(PATH + '/pta/permissions', json=payload, headers=headers)
    assert response.status_code == 201

    # data non valid
    payload = {}
    headers = {
        'Authorization': 'Bearer ' + TOKEN_A
    }
    response = requests.put(PATH + '/pta/permissions', json=payload, headers=headers)
    assert response.status_code == 400

    # permission issue
    payload = {
        "user": "userC",
        "level": "r"
    }
    headers = {
        'Authorization': 'Bearer ' + TOKEN_B
    }
    response = requests.put(PATH + '/pta/permissions', json=payload, headers=headers)
    assert response.status_code == 403

    # document not found
    payload = {
        "user": "userD",
        "level": "r"
    }
    headers = {
        'Authorization': 'Bearer ' + TOKEN_A
    }
    response = requests.put(PATH + '/wrong_id/permission', json=payload, headers=headers)
    assert response.status_code == 404  


